.GalleryContainer {
    height: 100%;
    display: flex;
    flex-direction: row;
    transition: transform 0.4s ease-out;
}

.GalleryContainer img {
    height: 100%;
    width: 100%;
    /*TODO : ADD OBJECT FIT POLYFILL */
    object-fit: contain;
}

.GalleryArrow {
    display: inline-block;
}

.ArrowIsHidden {
    display: none;
}

.Lightbox {
    display: none;
    position: absolute;
    z-index: 99;
    height: 100vh;
    width: 100%;
}

.Lightbox:before {
    content: '';
    position: absolute;
    z-index: 98;
    background: #000;
    height: 100%;
    width: 100%;
    opacity: 0.9;
}

.LightboxIsVisible {
    display: block;
}

.LightboxContainer .LightboxImgContainer {
    position: absolute;
    height: 80vh;
    width: 80%;
    z-index: 98;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
}

.LightboxImgContainer img {
    height: 100%;
    width: 100%;
    object-fit: contain;
}

.LightBoxClose, .LightBoxArrow {
    position: relative;
    z-index: 98;
}
